INSERT INTO `film` VALUES (1,'Lara Croft to niepokorna córka ekscentrycznego podróżnika, który zniknął, gdy dziewczyna miała kilkanaście lat. Teraz, jako 21-letnia kobieta, podąża własną ścieżką, odmawiając spełnienia woli ojca, który chciał dla niej spokojnego życia. Zostawia wszystko za sobą i udaje się w ostatnie znane miejsce jego pobytu. Poszukując śladów, musi odnaleźć osławiony grobowiec na mitycznej wyspie u wybrzeży Japonii. Jeśli nie przezwycięży własnych lęków, może nie przeżyć niezwykle niebezpiecznej wyprawy. Jak wiele poświęci, by poznać tajemnicę zniknięcia ojca i zyskać miano tomb raidera','Roar Uthaug','Przygodowy','http://localhost:8080/Filmapp/static/images/tombraider.jpg','Tomb Raider',2018),(2,'Po przeżyciu groźnego wypadku podczas serfowania, Wade Wilson (Ryan Reynolds) stara się spełnić swoje marzenia o sławie jako hodowca buldoga francuskiego, jednocześnie żyjąc w otwartym związku z ukochaną kobietą. Próbuje odzyskać swoją pasję do życia, toczy walki z wojownikami ninja i człowiekiem z metalu. Podróżuje po całym świecie, by odkrywać znaczenie rodziny, przyjaźni i by ubogacić swoje życie seksualne.','David Leitch','Akcja','http://localhost:8080/Filmapp/static/images/deadpool2.jpg','Dead Pool 2',2018),(3,'Komedia o trzydziestoletniej matce trójki dzieci, która musi zmierzyć się z młodą, ponętną, szaloną i tajemniczą nianią... ','Jason Reitman','Komedia','http://localhost:8080/Filmapp/static/images/tully.jpg','Tully',2018),(4,'Hellen Mirren i Donald Sutherland wcielają się w uciekającą parę, która udaje się w niezapomnianą podróż starym RV „Leisure Seeker”. Podróż zaczyna się w Bostonie, jej zwieńczeniem ma być dom Ernesta Hemingway’a w Key West. Podróż jest próbą odnalezienia pasji życia i miłości, która ich łączy, a podróż to niezwykła – pełna przygód i niespodzianek – od samego początku do końca.','Paolo Virzi','Dramat','http://localhost:8080/Filmapp/static/images/ellaijohn.jpg','Ella i John',2018),(5,'W „Han Solo. Gwiezdne wojny - historie” poznasz nieznane wcześniej przygody najsłynniejszego przemytnika w galaktyce! W czeluściach mrocznego i groźnego przestępczego półświatka, Han Solo zaprzyjaźnia się ze swoim przyszłym drugim pilotem Chewbaccą i poznaje hazardzistę Calrissiana. Tak rodzi się legenda jednego z najbardziej kultowych bohaterów w historii kina, znanego z późniejszej sagi Gwiezdne wojny.','Ron Howard','ScienceFiction','http://localhost:8080/Filmapp/static/images/hansolo.jpg','Han Solo: Gwiezdne wojny - historie',2018);
